import Sequelize from 'sequelize';
import casual from 'casual';
import _ from 'lodash';

const db = new Sequelize('SiteFrameDEV', 'zebraDEV', 'IamaZebra.', {
  host: 'lg-sql-07',
  dialect: 'mssql',
  operatorsAliases: false,

  pool: {
    max: 5,
    min: 0,
    acquire: 30000,
    idle: 10000
  }
});

const CommunityModel = db.define('community', {
  id: { type: Sequelize.INTEGER, primaryKey: true },
  name: { type: Sequelize.STRING }
});

const ApartmentModel = db.define('apartment', {
  id: { type: Sequelize.INTEGER, primaryKey: true },
  number: { type: Sequelize.STRING }
});

CommunityModel.hasMany(ApartmentModel);
ApartmentModel.belongsTo(CommunityModel);

// mock data
casual.seed(123);
db.sync({ force: true }).then(() => {
  _.times(10, () => {
    return CommunityModel.create({
      id: casual.id
    });
  });
});
